};

import jwt from "jsonwebtoken";
import dotenv from "dotenv";

dotenv.config();

export const getToken = (params) => {
  const token = jwt.sign(params, process.env.SECRET_KEY || "loginTokenKey", {
    expiresIn: process.env.EXPIRE_IN || "370d",
  });

  return token;
};

export const decoding = (token) => {
  const payload = jwt.verify(token, process.env.SECRET_KEY || "loginTokenKey");
  return payload;
};

import { User } from "../database/models";

export const checkUserExist = async (req, res, next) => {
  const { email } = req.body;
  const user = await User.findAll({
    where: {
      email,
    },
  });
  if (user.length > 0) {
    res.status(400).json({
      message: "User with email provided, is already registered",
    });
    return false;
  }
  next();
};

export const checkUserRegistered = async (req, res, next) => {
  const { email } = req.body;
  const user = await User.findOne({
    where: {
      email,
    },
  });
  if (!user) {
    res.status(400).json({
      message: "User doesn't exist,Please register",
    });
    return false;
  }
  req.user = user;
  next();
};

import joi from "joi";

export const userValidation = async (req, res, next) => {
  const userSchema = joi.object({
    name: joi.string().required().messages({
      "any.required": "Names are required",
    }),
    email: joi.string().required().messages({
      "any.required": "Email required",
    }),
    password: joi.string().min(8).required().messages({
      "any.required": "Password required",
      "string.min": "New Password require 8 characters",
    }),
  });
  const value = await userSchema.validate(req.body);
  if (value.error) {
    res.status(400).json({
      message: value.error.details[0].message,
    });
  } else {
    next();
  }
};

